script: |
  super -f text -I q4869.spq | sort > q4869.out

inputs:
  - name: q4869.spq
    data: |
      SELECT ALL + col2 - + + 90 * + + col0 AS col1 FROM tab0 (FORMAT parquet) AS cor0 WHERE NOT 24 NOT BETWEEN col0 * - - col1 + - ( 2 ) * + - col1 * col1 AND - col2;
  - name: tab0

outputs:
  - name: q4869.out
    data: |
